import React from 'react';
import './SoundscapesSection.css';

const ZenPositionSection: React.FC = () => {
  return (
    <section className="soundscapes-section">
      <div className="soundscapes-content">
        <h2 className='soundscapes-title'>SOUNDSCAPES</h2>
        <p>Immerse yourself in a calming audio environment tailored for deep relaxation. Our carefully curated soundscapes are designed to transport you into a state of tranquility, helping you unwind and rejuvenate effortlessly.</p>
        <ul>
          <li>Customizable sound profiles for your preferred ambiance</li>
          <li>Enhance relaxation with natural sounds and calming music</li>
          <li>Noise isolation to block external distractions</li>
          <li>Sync with personal playlists or choose from preloaded tracks</li>
        </ul>
      </div>
      <div className="soundscapes-image">
        <div className="image-frame">
          <img src={process.env.PUBLIC_URL + '/'} alt="Soundscapes" />
        </div>
      </div>
    </section>
  );
};

export default ZenPositionSection;
